import HomeGallery from "../components/home/HomeGallery";
import WhatsOn from "../components/home/WhatsOn";
import Information from "../components/home/Information";
import Map from "../components/home/Map";

const Home: React.FC = () => {
  return (
    <Fragment>
        <Landing />
        {/* <Bio /> */}
        <Menus />
        <Booking />
        <HomeGallery />
        <WhatsOn />
        <Information />
        <Map />
    </Fragment>
  )
}

export default Home;
